import React from 'react'
import { useSelector } from 'react-redux'

const Cart = () => {

    const {cart}=useSelector((state)=>state);
  return (
    <div>
         {  <div>
            cart.length>0?
            ():
            (   
                <div>
                <h1>Cart Empty</h1>
                <button>Shop Now</button>
                </div>
            )

            </div>
         }

    </div>
  )
}

export default Cart
